package com.brazedblue.intervox.dicom;class DicomDictionaryEntry extends Object /* implements anInterface */ {  private DicomElementTag fTag;  private DicomValueRep fValueRep;  private String fName;  public DicomDictionaryEntry(String group, String element, String valueRep, String name) {    fTag = new DicomElementTag(group, element);    fValueRep = new DicomValueRep(valueRep, DicomValueRep.IMPLICIT);    fName = name;  }  public String GetKey() {    return fTag.GetString();  }  public DicomValueRep GetValueRep() {    return fValueRep;  }  String GetName() {    return fName;  }  public String toString() {    return super.toString() + fTag.toString() + fValueRep.toString() + " Name- " + fName;  }}